import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import NavBar from './components/NavBar';
import HomePage from './components/HomePage';
import HighCourtPage from './components/HighCourtPage';
import DistrictCourtPage from './components/DistrictCourtPage';
import SupremeCourtPage from './components/SupremeCourtPage';

function App() {
  return (
    <Router>
      <NavBar />
      <Switch>
        <Route path="/" exact component={HomePage} />
        <Route path="/high" component={HighCourtPage} />
        <Route path="/district" component={DistrictCourtPage} />
        <Route path="/supreme" component={SupremeCourtPage} />
      </Switch>
    </Router>
  );
}

export default App;
